import React, { useState } from 'react';
import { useAppContext } from '../../context/AppContext';
import './Staff.css';

const Staff = () => {
  const { staffList, setStaffList } = useAppContext();
  const [selectedStaff, setSelectedStaff] = useState(null);

  const ratingOptions = ['CPL', 'PPL', 'MEA', 'IR', 'FIR'];
  const instructorCategories = ['Grade 1', 'Grade 2', 'Grade 3'];

  const handleStaffUpdate = (updatedStaff) => {
    setStaffList(staffList.map(staff => 
      staff.id === updatedStaff.id ? updatedStaff : staff
    ));
    setSelectedStaff(updatedStaff);
  };

  const handleAddStaff = () => {
    const newStaff = {
      id: `staff${Date.now()}`,
      firstName: '',
      lastName: '',
      email: '',
      phone: '',
      ratings: [],
      instructorCategory: '',
      active: true
    };
    setStaffList([...staffList, newStaff]);
    setSelectedStaff(newStaff);
  };

  const handleDeleteStaff = (staffId) => {
    if (window.confirm('Are you sure you want to delete this staff member?')) {
      setStaffList(staffList.filter(staff => staff.id !== staffId));
      setSelectedStaff(null);
    }
  };

  return (
    <div className="main-content">
      <div className="content-container">
        <div className="header">
          <h1>Staff Management</h1>
          <button className="new-booking-btn" onClick={handleAddStaff}>+ Add New Staff</button>
        </div>
        <div className="staff-grid">
          <div className="staff-list">
            {staffList.map(staff => (
              <div 
                key={staff.id} 
                className={`staff-item ${selectedStaff?.id === staff.id ? 'selected' : ''}`}
                onClick={() => setSelectedStaff(staff)}
              >
                <div className="staff-name">{staff.firstName} {staff.lastName}</div>
                <div className="staff-category">{staff.instructorCategory}</div>
              </div>
            ))}
          </div>
          
          {selectedStaff && (
            <div className="staff-details">
              <div className="details-header">
                <h2>Staff Details</h2>
                <button 
                  className="delete-btn"
                  onClick={() => handleDeleteStaff(selectedStaff.id)}
                >
                  Delete Staff
                </button>
              </div>
              <form className="details-form">
                <div className="form-group">
                  <label>First Name:</label>
                  <input
                    type="text"
                    value={selectedStaff.firstName}
                    onChange={(e) => handleStaffUpdate({
                      ...selectedStaff,
                      firstName: e.target.value
                    })}
                  />
                </div>
                
                <div className="form-group">
                  <label>Last Name:</label>
                  <input
                    type="text"
                    value={selectedStaff.lastName}
                    onChange={(e) => handleStaffUpdate({
                      ...selectedStaff,
                      lastName: e.target.value
                    })}
                  />
                </div>

                <div className="form-group">
                  <label>Email:</label>
                  <input
                    type="email"
                    value={selectedStaff.email}
                    onChange={(e) => handleStaffUpdate({
                      ...selectedStaff,
                      email: e.target.value
                    })}
                  />
                </div>

                <div className="form-group">
                  <label>Phone:</label>
                  <input
                    type="tel"
                    value={selectedStaff.phone}
                    onChange={(e) => handleStaffUpdate({
                      ...selectedStaff,
                      phone: e.target.value
                    })}
                  />
                </div>

                <div className="form-group">
                  <label>Ratings:</label>
                  <select
                    multiple
                    value={selectedStaff.ratings}
                    onChange={(e) => handleStaffUpdate({
                      ...selectedStaff,
                      ratings: Array.from(e.target.selectedOptions, option => option.value)
                    })}
                  >
                    {ratingOptions.map(rating => (
                      <option key={rating} value={rating}>{rating}</option>
                    ))}
                  </select>
                </div>

                <div className="form-group">
                  <label>Instructor Category:</label>
                  <select
                    value={selectedStaff.instructorCategory}
                    onChange={(e) => handleStaffUpdate({
                      ...selectedStaff,
                      instructorCategory: e.target.value
                    })}
                  >
                    <option value="">Select Category</option>
                    {instructorCategories.map(category => (
                      <option key={category} value={category}>{category}</option>
                    ))}
                  </select>
                </div>
              </form>
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default Staff;
